import 'geometry.dart';
import 'opening_hours.dart';
import 'photo.dart';
import 'plus_code.dart';

class Result {
  String? businessStatus;
  Geometry? geometry;
  String? icon;
  String? iconBackgroundColor;
  String? iconMaskBaseUri;
  String? name;
  OpeningHours? openingHours;
  List<Photo>? photos;
  String? placeId;
  PlusCode? plusCode;
  num? priceLevel;
  num? rating;
  String? reference;
  String? scope;
  List<String>? types;
  num? userRatingsTotal;
  String? vicinity;

  Result({
    this.businessStatus,
    this.geometry,
    this.icon,
    this.iconBackgroundColor,
    this.iconMaskBaseUri,
    this.name,
    this.openingHours,
    this.photos,
    this.placeId,
    this.plusCode,
    this.priceLevel,
    this.rating,
    this.reference,
    this.scope,
    this.types,
    this.userRatingsTotal,
    this.vicinity,
  });

  factory Result.(
      Map<String, dynamic> json) {
    return Result(
      businessStatus: json['business_status']?.toString(),
      geometry: json['geometry'] == null
          ? null
          : Geometry
              .(
                  Map<String, dynamic>.from(json['geometry'])),
      icon: json['icon']?.toString(),
      iconBackgroundColor: json['icon_background_color']?.toString(),
      iconMaskBaseUri: json['icon_mask_base_uri']?.toString(),
      name: json['name']?.toString(),
      openingHours: json['opening_hours'] == null
          ? null
          : OpeningHours
              .(
                  Map<String, dynamic>.from(json['opening_hours'])),
      photos: (json['photos'] as List<dynamic>?)
          ?.map((e) => Photo
              .(
                  Map<String, dynamic>.from(e)))
          .toList(),
      placeId: json['place_id']?.toString(),
      plusCode: json['plus_code'] == null
          ? null
          : PlusCode
              .(
                  Map<String, dynamic>.from(json['plus_code'])),
      priceLevel: num.tryParse(json['price_level'].toString()),
      rating: num.tryParse(json['rating'].toString()),
      reference: json['reference']?.toString(),
      scope: json['scope']?.toString(),
      types: List<String>.from(json['types'] ?? []),
      userRatingsTotal: num.tryParse(json['user_ratings_total'].toString()),
      vicinity: json['vicinity']?.toString(),
    );
  }

  Map<String, dynamic>
      () {
    return {
      if (businessStatus != null) 'business_status': businessStatus,
      if (geometry != null)
        'geometry': geometry
            ?.(),
      if (icon != null) 'icon': icon,
      if (iconBackgroundColor != null)
        'icon_background_color': iconBackgroundColor,
      if (iconMaskBaseUri != null) 'icon_mask_base_uri': iconMaskBaseUri,
      if (name != null) 'name': name,
      if (openingHours != null)
        'opening_hours': openingHours
            ?.(),
      if (photos != null)
        'photos': photos
            ?.map((e) => e
                .())
            .toList(),
      if (placeId != null) 'place_id': placeId,
      if (plusCode != null)
        'plus_code': plusCode
            ?.(),
      if (priceLevel != null) 'price_level': priceLevel,
      if (rating != null) 'rating': rating,
      if (reference != null) 'reference': reference,
      if (scope != null) 'scope': scope,
      if (types != null) 'types': types,
      if (userRatingsTotal != null) 'user_ratings_total': userRatingsTotal,
      if (vicinity != null) 'vicinity': vicinity,
    };
  }
}
